using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Text.RegularExpressions;
using System.Threading.Tasks;

namespace Business.Logic
{
    public class PhotoString
    {
        public string PhotoByteToString(byte[] b)
        {
            return "data:image/png;base64," + Convert.ToBase64String(b);
        }

        public string AudioByteToFile(byte[] b)
        {
            return "data:audio/mpeg;base64," + Convert.ToBase64String(b);
        }

       public string CleanInput(string strIn)
        {
            // Replace invalid characters with empty strings.
            try
            {
                return Regex.Replace(strIn, @"[^\w\.@-]", "",
                                     RegexOptions.None, TimeSpan.FromSeconds(1.5));
            }
            // If we timeout when replacing invalid characters, 
            // we should return Empty.
            catch (RegexMatchTimeoutException)
            {
                return String.Empty;
            }
        }

        public string stringforbyte = "";

        public string thumb = "data:image/png;base64,";


    }
}
